	<style type="text/css"> 
		*{
			margin:0px; padding:0px; 
		}
		.box{
			width:5px; height:5px; 
			background:red; 
			border: 1px solid transparent; 
			border-radius:50%; 
			margin:5px; 
			float:left; 
			animation:box-cir-anim 5s infinite; 
		}
		
		@keyframes box-cir-anim{
			0%{ border-radius:50%; background:red; margin:5px; }
			40%{ border-radius:25%; background:purple; margin:7px; }
			80%{ border-radius:0%; background:lightgreen; margin:8px;}
			100%{ border-radius:0%; background:lightgreen; margin:10px;}
		}
		.wrapper{
			width:100%; height:100vh; 
			 
		}
		.wrapper-over{
			width:100%; 
			height:100vh; margin-top:; 
			background:rgba(0,0,0,0.9); 
			margin-top:-100vh; 
			 
		}
	</style>
